import './App.css';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

import Home from './Home';

function App() {
  return (
    <BrowserRouter>
      <main>
        <Routes>
          <Route path='/' element={<Home />} />
          {/* <Route path='/DigitalProgramming' element={<DigitalProgramming />} /> */}
          {/* <Route path='/Linkedin' element={<LinkedIn />} /> */}
        </Routes>
      </main>
    </BrowserRouter>
  );
}

export default App;
